<!doctype html>
<html lang="en">

	<head>
		<meta charset="utf-8" />
		<meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no" />
		<link rel="icon" type="image/png" href="images/logo.png" />
		<title>Spiny Owl</title>
		<style>

		div {
			padding: 0;
			margin: 0;
		}
        html {
            width: 100%;
            height: 100%;
            max-width: 100%;
            max-height: 100%;
            padding: 0;
            margin: 0;
        }

        body {
            width: 100%;
            height: 100%;
            max-width: 100%;
            max-height: 100%;
            padding: 0;
            margin: 0;
			background-image: linear-gradient(-100deg, #111 0%, #222 50%, #111 100%);
        }
		
		.container {
            padding: 0;
            margin: 0;
			display: flex;
			flex-direction: column;
			align-items: stretch;
			align-content: stretch;
			justify-content: flex-start;
            width: 100%;
            height: 100%;
            max-width: 100%;
            max-height: 100%;
			min-width: 200px;
			min-height: 320px;
		}
		
		.footer{
            padding: 0;
            margin: 0;
			min-height: 120px;
		}
		
		.owl {
            background-image: url('images/logo.png');
            background-size: contain;
            background-position: center;
            background-repeat: no-repeat;
			flex: 1;
			min-width: 200px;
			min-height: 200px;
		}

		.welcome{
			text-align: center;
			color: white;
			font-family: HighTide;
            max-width: 100%;
            max-height: 100%;
		}
